metadata.description:
The model renders surfaces in three-dimensional space.

Made with p5.js, WEBGL and math.

There are three traits:
- 6 “Color scheme”;
- 4 “Transformer”;
- 2 “Background”;
- 2 "Color mixer;
- 2 "Asymmetric";
- 4 "Number of edges".

Each token is 100% unique.

Press 's' to save .png with resolution 2000px * 2000px
